import java.util.ArrayList;

public class Main {
    public static void main(String[] args) {
        ArrayList<Integer> list = new ArrayList<>();
        /* initial population */
        for (int i = 0; i < 5; i++) {
            list.add(i * 2);  // Adds 0, 2, 4, 6, 8
        }

        /* write */
        int sum = 0;
        for (int i = 0; i < list.size(); i++) {
            sum += list.get(i);
        }
        if (sum % 10 > 5) {
            list.add(42);
        } else {
            list.add(24);
        }

        /* misleading operations */
        list.set(2, 100);
        list.add(200);
        list.remove(0);

        System.out.println("Current state of list: " + list);

        /* read */
        int ret = list.get(5);
        System.out.println("Retrieved value: " + ret);
    }
}
